public class CharArraySanitizationTest {

    @Test
    public void testCharacterSequenceSanitization() {
        // Scenario 1: Character sequence holder initialized with no content
        CharArray noContentHolder = new CharArray(new char[0]);
        noContentHolder.clear();
        char[] noContentResult = noContentHolder.get();

        // Verify that clearing a holder with no content results in no content being returned
        assertEquals(0, noContentResult.length, "No content holder should remain empty after clearing");
        assertArrayEquals(new char[0], noContentResult, "No content holder should be empty array after clearing");

        // Scenario 2: Character sequence holder with an empty sequence
        CharArray emptyHolder = new CharArray(new char[0]);
        emptyHolder.clear();
        char[] emptyResult = emptyHolder.get();

        // Verify that clearing an already empty sequence maintains the empty state
        assertEquals(0, emptyResult.length, "Empty holder should remain empty after clearing");
        assertArrayEquals(new char[0], emptyResult, "Empty holder should remain empty array after clearing");

        // Scenario 3: Character sequence holder with actual sensitive data
        CharArray dataHolder = new CharArray("sensitiveData".toCharArray());
        int originalLength = dataHolder.get().length;
        dataHolder.clear();
        char[] sanitizedResult = dataHolder.get();

        // Verify that clearing replaces all characters with neutral placeholders while preserving the original length
        assertEquals(originalLength, sanitizedResult.length, "Length should be preserved after clearing");

        // Create expected array of null characters with the same length
        char[] expectedSanitized = new char[originalLength];
        for (int i = 0; i < originalLength; i++) {
            expectedSanitized[i] = '\0'; // null character
        }

        assertArrayEquals(expectedSanitized, sanitizedResult, "Data should be sanitized with null characters");
    }
}

