import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class BasicDataSourceReadOnlyTest {

    @Test
    public void testReadOnlyStateTransitions() throws Exception {
        // Establish a fresh connection pooling system with no initial read-only preference configured
        BasicDataSource connectionPoolingSystem = new BasicDataSource();

        // Verify that when no preference has been set, the system indicates the read-only setting is absent
        assertNull(connectionPoolingSystem.getDefaultReadOnly(), "Initial read-only setting should be absent");

        // Enable the read-only mode for the default user pool
        connectionPoolingSystem.setDefaultReadOnly(true);

        // Confirm the system reflects the enabled state
        assertTrue(connectionPoolingSystem.getDefaultReadOnly(), "Read-only mode should be enabled");

        // Disable the read-only mode
        connectionPoolingSystem.setDefaultReadOnly(false);

        // Ensure the system accurately reports it as disabled
        assertFalse(connectionPoolingSystem.getDefaultReadOnly(), "Read-only mode should be disabled");

        // Re-enable the read-only mode once more
        connectionPoolingSystem.setDefaultReadOnly(true);

        // Verify the system can toggle back to the enabled state successfully
        assertTrue(connectionPoolingSystem.getDefaultReadOnly(), "Read-only mode should be enabled again");

        // Clear the read-only preference entirely by removing any configured value
        connectionPoolingSystem.setDefaultReadOnly(null);

        // Confirm the system returns to indicating no read-only setting is present
        assertNull(connectionPoolingSystem.getDefaultReadOnly(), "Read-only preference should be cleared");

        // Release the connection pooling system resources
        connectionPoolingSystem.close();
    }
}

