class PerUserPoolDataSourceTest {

    @Test
    void testDefaultReadOnlyPropertyLifecycle() {
        // Instantiate a fresh data source instance within try-with-resources
        try (PerUserPoolDataSource dataSource = new PerUserPoolDataSource()) {

            // Query the default read-only property
            Boolean initialValue = dataSource.isDefaultReadOnly();

            // Assert that the initial value is null
            assertNull(initialValue, "Initial default read-only property should be null");

            // Set the default read-only property to true
            dataSource.setDefaultReadOnly(Boolean.TRUE);

            // Retrieve the default read-only property value
            Boolean valueAfterSetTrue = dataSource.isDefaultReadOnly();

            // Assert that the value is true
            assertTrue(valueAfterSetTrue, "Default read-only property should be true after setting it to true");

            // Set the default read-only property to false
            dataSource.setDefaultReadOnly(Boolean.FALSE);

            // Retrieve the default read-only property value
            Boolean valueAfterSetFalse = dataSource.isDefaultReadOnly();

            // Assert that the value is false
            assertFalse(valueAfterSetFalse, "Default read-only property should be false after setting it to false");

            // Set the default read-only property back to true
            dataSource.setDefaultReadOnly(Boolean.TRUE);

            // Retrieve the default read-only property value
            Boolean valueAfterResetTrue = dataSource.isDefaultReadOnly();

            // Assert that the value is true
            assertTrue(valueAfterResetTrue, "Default read-only property should be true after resetting it to true");

            // Set the default read-only property to null
            dataSource.setDefaultReadOnly(null);

            // Retrieve the default read-only property value
            Boolean finalValue = dataSource.isDefaultReadOnly();

            // Assert that the final value is null
            assertNull(finalValue, "Default read-only property should be null after setting it to null");
        }
        // Close method is automatically called by try-with-resources
    }
}

package org.apache.commons.dbcp2.datasources;

import org.apache.commons.dbcp2.Utils;
import org.apache.commons.dbcp2.cpdsadapter.DriverAdapterCPDS;
import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import javax.sql.DataSource;
import java.sql.Connection;
import java.time.Duration;
import java.util.Stack;
import java.lang.AutoCloseable;

import static org.junit.jupiter.api.Assertions.assertNull;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.junit.jupiter.api.Assertions.assertFalse;

public class PerUserPoolDataSourceTest {

    private static final Duration DURATION_1_MILLISECOND = Duration.ofMillis(1);
    private DataSource ds;
    private String user;
    private Stack<Connection> connectionStack;

    @BeforeEach
    public void setUp() {
        user = "foo";
        DriverAdapterCPDS pcds = new DriverAdapterCPDS();
        pcds.setDriver("org.apache.commons.dbcp2.TesterDriver");
        pcds.setUrl("jdbc:apache:commons:testdriver");
        pcds.setUser(user);
        pcds.setPassword("bar");
        pcds.setAccessToUnderlyingConnectionAllowed(true);

        PerUserPoolDataSource tds = new PerUserPoolDataSource();
        tds.setConnectionPoolDataSource(pcds);
        tds.setDefaultMaxTotal(tds.getDefaultMaxTotal());
        tds.setDefaultMaxWait(tds.getDefaultMaxWait());
        tds.setPerUserMaxTotal(user, tds.getDefaultMaxTotal());
        tds.setPerUserMaxWait(user, tds.getDefaultMaxWait());
        tds.setDefaultTransactionIsolation(Connection.TRANSACTION_READ_COMMITTED);
        tds.setDefaultAutoCommit(Boolean.TRUE);
        ds = tds;
    }

    @Test
    public void testDefaultReadOnly() {
        try (PerUserPoolDataSource ds = new PerUserPoolDataSource()) {
            assertNull(ds.isDefaultReadOnly());
            ds.setDefaultReadOnly(true);
            assertTrue(ds.isDefaultReadOnly().booleanValue());
            ds.setDefaultReadOnly(false);
            assertFalse(ds.isDefaultReadOnly().booleanValue());
            ds.setDefaultReadOnly(true);
            assertTrue(ds.isDefaultReadOnly().booleanValue());
            ds.setDefaultReadOnly(null);
            assertNull(ds.isDefaultReadOnly());
        }
    }

    @AfterEach
    public void tearDown() {
        // Define and call a private method to close connections in stack
        if (connectionStack != null) {
            while (!connectionStack.isEmpty()) {
                Connection conn = connectionStack.pop();
                if (conn instanceof AutoCloseable) {
                    Utils.closeQuietly((AutoCloseable) conn);
                }
            }
        }

        // Close the main data source
        if (ds instanceof PerUserPoolDataSource) {
            ((PerUserPoolDataSource) ds).close();
        }
    }
}

